import React from 'react';
import styled from 'styled-components';
import ListItem from './ListItem';

const ListBox = styled.div`
    position: absolute;
    width:772px;
    height:256px;
    border: 1px solid black;
    margin-top: 330px;
    display: flex;
    justify-content: center;
`;

const List = () => {
    return (
        <ListBox>
            <ListItem />
            <ListItem />
            <ListItem />
        </ListBox>
    );
};

export default List;
